import React from "react";
import "./ParentVisitSheet.css";

const ParentVisitSheet = () => {
  return (
    <div className="page">
      <h2>Parent Visit Sheet</h2>
      <p>Details of parent visits go here.</p>
    </div>
  );
};

export default ParentVisitSheet;
